import './App.css';
import { createBrowserRouter,createRoutesFromElements,Route,RouterProvider } from "react-router-dom"

import Layout from './Components/Layout';
import HomePage from './Components/Pages/HomePage';
import LatestMovies from './Components/Pages/LatestMovies';
import MoviesDetails from './Components/Pages/MoviesDetails';
import NearByEvent from './Components/Pages/NearByEvent';
import FinalBooking from './Components/Pages/FinalBooking';
import TicketBooking from './Components/Pages/TicketBooking';
import UpcomingMovies from './Components/Pages/UpcomingMovies';
function App() {
  const router=createBrowserRouter(createRoutesFromElements(
    <Route path="/" element={<Layout/>}>
      <Route path="/" element={<HomePage/>}/>
      <Route path="/LatestMovies" element={<LatestMovies/>}/>
      <Route path="/MovieDetails/:id" element={<MoviesDetails/>}/>
      <Route path="/NearByEvents" element={<NearByEvent/>}/>
      <Route path="/TicketBooking" element={<TicketBooking/>}/>
      <Route path="/FinalBooking" element={<FinalBooking/>}/>
      <Route path="/UpcomingMovies" element={<UpcomingMovies/>}/>
    </Route>
  ))
  return(

  <div className="App">
  <RouterProvider router={router}></RouterProvider>
  </div>
  )}

export default App;
